import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="row" style={rowStyle}>
      <div className="col-xs-4" style={elementStyles}>
        June 20th 2022
      </div>
      <div className="col-xs-4" style={elementStyles}>
        Car Insurance
      </div>
      <div className="col-xs-4" style={elementStyles}>
        $184.00
      </div>
    </div>
  );
}

const elementStyles = {
  paddingLeft: 10,
  paddingRight: 10,
  fontSize: 18,
};

const rowStyle = {
  display: "flex",
  justifyVontent: "space-between",
  alignItems: "center",
  boxShadow: "0 2 8 rgba(0, 0, 0, 0.25)",
  padding: "0.5rem",
  margin: "1rem 0",
  borderRadius: "12px",
  backgroundColor: "#4b4b4b",
};

export default ExpenseItem;
